import React, { useState } from 'react';
import Modal from './Layouts/modal';
import {Button} from 'react-bootstrap';
import useModal from './hook/useModal';
import MyNotify from './Layouts/mynotify';
import PaypalCheckout from './Layouts/PaypalCheckout';
import axios from 'axios';
import { Link } from 'react-router-dom';


const [isOpenLoginModal, openLoginModal ,closeLoginModal ] = useModal();

export default class Test extends Component{
     
    async componentDidMount() {
        this.getComunas();
    }

    getMontoPago = async () =>{
        const res = await axios.get()
    }

    getComunas = async () => {
        const res = await axios.get('http://localhost:4000/API/comuna/')
        this.setState({
            comunas: res.data
        })
    }

    getUsuarios = async () => {
        const res = await axios.get('http://localhost:4000/API/usuario')
        this.setState({
            Usuarios: res.data
        });
    }
    
    render(){
        return (
            <div>
                <Button onClick={openLoginModal}>
                    Open Modal
                </Button>

                <Modal
                    isOpen={isOpenLoginModal} 
                    closeModal={closeLoginModal}
                    title="soy un Modal"
                >
                    <form>
                    <input 
                        type="email"
                        placeholder="Correo"
                    />
                    <input 
                        type="password"
                        placeholder="Contraseña"
                    />
                    </form>
                </Modal>
                <MyNotify
                    type={'success'} 
                    title= {'Operación realizada con éxito'}
                    message="Soy un Toast"
                />

                <PaypalCheckout/>
            </div>
        )
    }
}
